desc:
Once per turn: You can activate 1 of these effects (but you can only use each effect of "Eternal Favorite" once per turn);
● Special Summon 1 of your "Yubel" monsters that is banished or in your GY. Neither player can activate cards or effects when that monster is Special Summoned.
● If you control "Yubel": Discard 1 card and send this face-up card to the GY; Fusion Summon 1 Fusion Monster from your Extra Deck, using monsters from either field as material, including a "Yubel" monster.

Your opponent cannot target "Blue-Eyes White Dragon" in your Monster Zone with card effects. If this face-up card is sent from the Spell & Trap Zone to the GY: Destroy all monsters you control. You can only use the following effect of "True Light" once per turn. You can activate 1 of these effects;
● Special Summon 1 "Blue-Eyes White Dragon" from your hand or GY.
● Set 1 Spell/Trap directly from your Deck, that specifically lists "Blue-Eyes White Dragon" in its text, with a different name from the cards you control and in your GY.

If this card battles a monster, neither can be destroyed by that battle. During the Main Phase, if a monster(s) your opponent controls is sent to the GY: You can activate the following effect, based on where this card is at activation (but you can only use each effect of "Vouiburial, the Dragon Undertaker" once per turn);
● Hand: Special Summon this card.
● Field: Make 1 Effect Monster your opponent controls lose 1500 ATK, then if its ATK becomes 0 by this effect, you can destroy it.
